import React, { useState } from 'react';
import { Card, Button, Container, Row, Col, Form, Table } from 'react-bootstrap';

function AddStudentCourses() {
  const [selectedStudentId, setSelectedStudentId] = useState('');
  const [selectedCourseId, setSelectedCourseId] = useState('');

  // بيانات وهمية للطلاب والمواد
  const students = [
    { id: 1, full_name: 'أحمد علي' },
    { id: 2, full_name: 'سارة محمد' },
  ];

  const courses = [
    { id: 1, name: 'رياضيات' },
    { id: 2, name: 'فيزياء' },
  ];

  const studentCourses = [
    { id: 1, student_name: 'أحمد علي', course_name: 'رياضيات' },
    { id: 2, student_name: 'سارة محمد', course_name: 'فيزياء' },
  ];

  return (
    <Container className="mt-4">
      <Row className="justify-content-center">
        <Col md={10}>
          <Card className="shadow-sm border-0">
            <Card.Header className="bg-primary text-white p-3">
              <h5 className="fw-bold m-0">إضافة طالب إلى مادة</h5>
            </Card.Header>

            <Card.Body>
              <Form>
                <Form.Group>
                  <Form.Label>اختر الطالب</Form.Label>
                  <Form.Control
                    as="select"
                    value={selectedStudentId}
                    onChange={(e) => setSelectedStudentId(e.target.value)}
                  >
                    <option value="">اختر الطالب</option>
                    {students.map((student) => (
                      <option key={student.id} value={student.id}>
                        {student.full_name}
                      </option>
                    ))}
                  </Form.Control>
                </Form.Group>

                <Form.Group className="mt-3">
                  <Form.Label>اختر المادة</Form.Label>
                  <Form.Control
                    as="select"
                    value={selectedCourseId}
                    onChange={(e) => setSelectedCourseId(e.target.value)}
                  >
                    <option value="">اختر المادة</option>
                    {courses.map((course) => (
                      <option key={course.id} value={course.id}>
                        {course.name}
                      </option>
                    ))}
                  </Form.Control>
                </Form.Group>

                <Button variant="success" className="mt-3">إضافة</Button>
              </Form>

              <h6 className="mt-4">جميع التسجيلات</h6>
              <Table striped bordered hover className="mt-3">
                <thead>
                  <tr>
                    <th>اسم الطالب</th>
                    <th>اسم المادة</th>
                    <th>تعديل</th>
                  </tr>
                </thead>
                <tbody>
                  {studentCourses.map((item) => (
                    <tr key={item.id}>
                      <td>{item.student_name}</td>
                      <td>{item.course_name}</td>
                      <td>
                        <Button variant="warning">تعديل</Button>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </Table>
            </Card.Body>
          </Card>
        </Col>
      </Row>
    </Container>
  );
}

export default AddStudentCourses;
